import React from "react";
import CardsCompiler from "../RecipeCards/DetailsCard";

const Posts = ({ posts, loading }) => {
  if (loading) {
    return <h2>Loading...</h2>;
  }

  return (
    <div>
      <CardsCompiler recipe={posts} />
    </div>
  );
};
